import { Link } from "react-router-dom";
import { ArrowRight } from "lucide-react";

export default function Home() {
  return (
    <div
      className="relative min-h-screen w-full flex flex-col items-center justify-center"
      style={{
        backgroundImage: "url('/background.jpg')",
        backgroundSize: "cover",
        backgroundPosition: "center",
        backgroundRepeat: "no-repeat",
      }}
    >
      {/* Overlay for readability */}
      <div className="absolute inset-0 bg-white/60 backdrop-blur-lg"></div>

      {/* Main Content */}
      <div className="relative w-full max-w-6xl px-6 space-y-16">
        {/* Hero Section */}
        <div className="text-center bg-gradient-to-br from-blue-50 to-purple-50 py-20 rounded-xl shadow-md w-full">
          <h1 className="text-4xl font-bold text-gray-900 sm:text-5xl md:text-6xl">
            AI-Powered De-Smoking & De-Hazing
          </h1>
          <p className="mt-4 max-w-2xl mx-auto text-lg text-gray-600 sm:text-xl md:mt-6">
            Transform hazy and smoke-affected images into crystal clear visuals using our advanced AI algorithm.
          </p>
          <div className="mt-8">
            <Link
              to="/upload"
              className="inline-flex items-center justify-center px-8 py-3 bg-gradient-to-r from-blue-600 to-purple-600 text-white font-semibold rounded-lg hover:from-blue-700 hover:to-purple-700 transition-all duration-300 transform hover:scale-105 shadow-lg"
            >
              Get Started
              <ArrowRight className="ml-2 h-5 w-5" />
            </Link>
          </div>
        </div>

        {/* How It Works Section */}
        <div className="bg-white/90 rounded-xl shadow-lg border border-gray-200 overflow-hidden p-8 backdrop-blur-md w-full">
          <h2 className="text-3xl font-bold text-gray-900 text-center">
            How It Works
          </h2>
          <div className="mt-8 grid gap-8 sm:grid-cols-2 lg:grid-cols-3">
            {[
              { step: "1. Upload Your Image", description: "Simply upload your hazy or smoke-affected images." },
              { step: "2. AI Processing", description: "Our AI model enhances your image with clarity." },
              { step: "3. Download the Results", description: "Download your clear image with improved visibility." },
            ].map((item, index) => (
              <div key={index} className="p-6 bg-gradient-to-br from-blue-50 to-purple-50 rounded-lg shadow-md">
                <h3 className="text-xl font-semibold text-gray-900">{item.step}</h3>
                <p className="mt-2 text-gray-600">{item.description}</p>
              </div>
            ))}
          </div>
        </div>

        {/* Call-to-Action Section */}
        <div className="text-center bg-gradient-to-br from-blue-600 to-purple-600 py-12 rounded-xl shadow-lg w-full">
          <h2 className="text-3xl font-bold text-white">Ready to Transform Your Images?</h2>
          <p className="mt-4 text-lg text-blue-100">Experience the power of AI for image enhancement.</p>
          <div className="mt-8">
            <Link
              to="/upload"
              className="inline-flex items-center justify-center px-8 py-3 bg-white text-blue-600 font-semibold rounded-lg hover:bg-blue-100 transition-all duration-300 transform hover:scale-105 shadow-lg"
            >
              Get Started Now
              <ArrowRight className="ml-2 h-5 w-5" />
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
}
